import React from 'react';
import { Link } from 'react-router-dom';
import { 
  HiHome, 
  HiChartBar, 
  HiUsers, 
  HiVideoCamera, 
  HiCog,
  HiLightningBolt, 
  HiDocumentReport,
  HiUpload,
  HiCreditCard
} from 'react-icons/hi';

const Sidebar = ({ currentNav, setCurrentNav }) => {
  const navItems = [
    { id: 'Dashboard', icon: <HiHome className="w-6 h-6" />, label: 'Dashboard' },
    { id: 'Upload Video', icon: <HiUpload className="w-6 h-6" />, label: 'Upload Video' },
    { id: 'Overall Stats', icon: <HiChartBar className="w-6 h-6" />, label: 'Match Statistics' },
    { id: 'Recordings', icon: <HiVideoCamera className="w-6 h-6" />, label: 'Recordings' },
    { id: 'Game_01', icon: <HiLightningBolt className="w-6 h-6" />, label: 'Ball Tracking' },
    { id: 'Opponents', icon: <HiUsers className="w-6 h-6" />, label: 'Players' },
    { id: 'Game_02', icon: <HiDocumentReport className="w-6 h-6" />, label: 'Bounce Analysis' },
    { id: 'Payment plans', icon: <HiCreditCard className="w-6 h-6" />, label: 'Subscription' },
    { id: 'Settings', icon: <HiCog className="w-6 h-6" />, label: 'Settings' },
  ];

  return (
    <div className="h-screen fixed left-0 top-0 w-64 bg-gray-900 shadow-lg flex flex-col">
      <div className="p-4 border-b border-gray-800">
        <div className="flex items-center space-x-2">
          <img 
            src="/assets/logo.png" 
            alt="CourtCheck Logo" 
            className="h-8 w-8"
            onError={(e) => {
              e.target.onerror = null;
              e.target.src = 'https://via.placeholder.com/32/3b82f6/ffffff?text=CC';
            }}
          />
          <span className="text-xl font-bold text-white">CourtCheck</span>
        </div>
        <div className="mt-2 text-xs text-gray-400">
          Tennis Analysis for UC Davis
        </div>
      </div>

      <nav className="py-6 flex-1 overflow-y-auto">
        <ul className="space-y-1 px-3">
          {navItems.map((item) => (
            <li key={item.id}>
              <Link
                to={`/${item.id === 'Dashboard' ? '' : item.id.toLowerCase().replace(/\s+/g, '-')}`}
                className={`flex items-center px-4 py-3 rounded-lg transition-colors ${
                  currentNav === item.id
                    ? 'bg-blue-700 text-white'
                    : 'text-gray-400 hover:bg-gray-800 hover:text-gray-200'
                }`}
                onClick={() => setCurrentNav(item.id)}
              >
                <span className="mr-3">{item.icon}</span>
                <span>{item.label}</span>
                {item.id === 'Upload Video' && (
                  <span className="ml-auto bg-green-600 text-xs px-2 py-1 rounded-full text-white">
                    New
                  </span>
                )}
              </Link>
            </li>
          ))}
        </ul>
      </nav>

      <div className="p-4 border-t border-gray-800">
        <div className="flex items-center">
          <img
            src="/assets/avatar.jpg"
            alt="User"
            className="w-10 h-10 rounded-full"
            onError={(e) => {
              e.target.onerror = null;
              e.target.src = 'https://via.placeholder.com/40/4b5563/ffffff?text=U';
            }}
          />
          <div className="ml-3">
            <p className="text-sm font-medium text-white">Coach Williams</p>
            <p className="text-xs text-gray-400">UC Davis Tennis</p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Sidebar;
